--
-- Create procedure `procGetProductOrderByName`
--
CREATE PROCEDURE procGetProductOrderByName (IN orderVar int)
SQL SECURITY INVOKER
COMMENT 'Lấy danh sách sản phẩm theo tên a-z'
BEGIN
  IF (orderVar = 0) THEN
    SELECT
      p.productId,
      p.productName
    FROM product p
    ORDER BY p.productName ASC;
  ELSE
    SELECT
      p.productId,
      p.productName
    FROM product p
    ORDER BY p.productName DESC;
  END IF;
END
$$

