ADD CONSTRAINT FK_cart_productId FOREIGN KEY (productId)
REFERENCES product (productId) ON DELETE NO ACTION;

DELIMITER $$

--
-- Create procedure `procUpdateCart`
--
CREATE PROCEDURE procUpdateCart (IN cartId char(36), IN productId char(36), IN customerId char(36), IN quantity int(11), IN total double, IN createdDate datetime, IN createdBy varchar(100), IN modifiedDate datetime, IN selectedItem bit)
SQL SECURITY INVOKER
COMMENT 'Thủ tục cập nhật giỏ hàng'
BEGIN
  UPDATE cart c
  SET c.quantity = quantity,
      total = (SELECT
          price
        FROM product p
        WHERE p.productId = productId) * quantity,
      c.modifedDate = NOW()
  WHERE c.cartId = cartId;
END
$$

--
-- Create procedure `procInsertCart`
--
CREATE PROCEDURE procInsertCart (IN cartId char(36), IN productId char(36), IN customerId char(36), IN quantity int(11), IN total double, IN createdDate datetime, IN createdBy varchar(100), IN modifiedDate datetime, IN selectedItem bit)
SQL SECURITY INVOKER
COMMENT 'Thủ tục thêm 1 bản ghi giỏ hàng'
BEGIN
  INSERT INTO cart (cartId, productId, customerId, quantity, total, createdDate, createdBy, modifedDate)
    VALUES (UUID(), productId, customerId, quantity, (SELECT price FROM product p WHERE p.productId = productId) * quantity, NOW(), '', NOW());
END
$$

