--
-- Create procedure `procSearchProduct`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE procSearchProduct (IN productName varchar(255))
COMMENT 'Thủ tục tìm kiếm mặt hàng '
BEGIN
  IF (productName IS NOT NULL
    AND productName <> '') THEN
    SELECT
      p.productId,
      p.productName,
      p.categoryId,
      p.price,
      p.discount,
      p.hot,
      p.image,
      p.description,
      p.providerId,
      p.status
    FROM product p
    WHERE p.productName LIKE CONCAT('%', productName, '%');
  END IF;
END
$$

