--
-- Create procedure `procGetProductByCategory`
--
CREATE PROCEDURE procGetProductByCategory (IN categoryId char(36), IN orderVal int(11))
SQL SECURITY INVOKER
COMMENT 'Thủ tục lấy danh sách sản phẩm theo mã danh mục ( 1 - Sắp xép theo tên z-a ; 2 - Sắp xếp theo giá tăng dần; 3 - sắp xếp theo giá giảm dần; mặc định - sắp xếp theo tên a - z ) '
BEGIN
  IF (orderVal = 1) THEN
    SELECT
      p.productId,
      p.productName,
      p.categoryId,
      p.price,
      p.discount,
      p.hot,
      p.image,
      p.description,
      p.providerId,
      p.status
    FROM product p
    WHERE p.categoryId = categoryId
    ORDER BY p.productName DESC;
  ELSEIF (orderVal = 2) THEN
    SELECT
      p.productId,
      p.productName,
      p.categoryId,
      p.price,
      p.discount,
      p.hot,
      p.image,
      p.description,
      p.providerId,
      p.status
    FROM product p
    WHERE p.categoryId = categoryId
    ORDER BY p.price ASC;
  ELSEIF (orderVal = 3) THEN
    SELECT
      p.productId,
      p.productName,
      p.categoryId,
      p.price,
      p.discount,
      p.hot,
      p.image,
      p.description,
      p.providerId,
      p.status
    FROM product p
    WHERE p.categoryId = categoryId
    ORDER BY p.price DESC;
  ELSE
    SELECT
      p.productId,
      p.productName,
      p.categoryId,
      p.price,
      p.discount,
      p.hot,
      p.image,
      p.description,
      p.providerId,
      p.status
    FROM product p
    WHERE p.categoryId = categoryId
    ORDER BY p.productName ASC;
  END IF;
END
$$

