INSERT INTO news(newsId, newsTitle, newsDescription, newsContent, hotNews, newsImage, newsBy, createdDate, createdBy, modifiedDate) VALUES
('19029793-2caa-7372-e03d-c9e9e9038fe2', 'Người Việt Nam yêu hoa nhất thế giới.', 'Tại sao nên để hoa cách xa trái cây', 'Sequi assumenda, neque sapiente necessitatibus culpa quae quis nostrum aut laudantium sed alias atque omnis. Sunt nobis perspiciatis quia omnis, aut tempore cupiditate perferendis in sed laudantium fuga praesentium eos! Perferendis amet, error nihil quis nihil nostrum eveniet sed facilis quod laborum veritatis vitae iste; molestias quia aut unde ab, sunt repudiandae iste id suscipit perspiciatis quibusdam adipisci id quia; perspiciatis unde veritatis labore unde, quod tempore inventore et saepe magni vero pariatur aut quisquam...\r\nAccusamus officiis error maxime ea ut officiis neque delectus modi vel est eaque unde quis. Sit qui aut est maiores labore ut odit reiciendis aperiam quia quo ut eum laborum! Suscipit at, sed veniam perspiciatis dolore quo suscipit delectus atque quisquam enim sit quo veniam. Animi sed est recusandae in, qui error sed ut neque omnis iusto veniam quos quis. Sed sint vitae ea quis nostrum quos voluptate porro sed beatae non consequatur error quam? Aperiam tenetur harum, error quo numquam eos aut ullam nemo natus vero similique modi ea; quia sit, labore quia quos doloribus consequatur iusto minus rerum eius inventore numquam error unde. Quisquam autem, commodi quis magnam quas officia quas qui facilis nisi fuga quia ullam qui! Eos ut dolor consequatur quidem unde iusto eum sit qui autem aut ullam consequuntur et. Ea dignissimos, dolor sit earum non aut iste autem rerum ullam vero totam iste explicabo. Hic tenetur rerum est ipsa vero dolorem perspiciatis omnis ad provident non culpa quia a. Adipisci odit obcaecati ducimus, reprehenderit est atque porro a eum labore reiciendis dolores provident quia.', False, 'https://i1-vnexpress.vnecdn.net/2019/09/05/1302413816-w500-1567678650-4347-1567678678.png?w=500&h=300&q=100&dpr=1&fit=crop&s=_qlNqhhvJ_XDO1ljsSj5mQ', 'S18R6CH', '1994-02-01 18:35:24', 'Althea Heath', '2022-05-07 13:30:27'),
('1944b789-48b3-5241-f588-479bce9b28fc', '4 yếu tố làm nên thương hiệu hoa xuất khẩu Dalat Hasfarm', 'Dalat Hasfarm là một trong số ít thương hiệu nông sản Việt Nam nói chung, hoa tươi nói riêng đáp ứng được những yêu cầu khắt khe của thị trường xuất khẩu. Sau 25 năm phát triển, công ty hiện có 4 trang trại rộng gần 320 hecta, cung cấp hơn 450 triệu ngọn giống, 200 triệu cành hoa với 50% sản lượng hoa xuất khẩu và hàng triệu chậu hoa mỗi năm.', '<h2><strong>4 yếu tố làm nên thương hiệu hoa xuất khẩu Dalat Hasfarm</strong></h2><p>Đầu tư công nghệ, quản lý chất lượng, đổi mới sản phẩm, sản xuất hoa sạch... giúp Dalat Hasfarm trở thành một trong những công ty hoa tươi hàng đầu Việt Nam.</p><p>Dalat Hasfarm là một trong số ít thương hiệu nông sản Việt Nam nói chung, hoa tươi nói riêng đáp ứng được những yêu cầu khắt khe của thị trường xuất khẩu. Sau 25 năm phát triển, công ty hiện có 4 trang trại rộng gần 320 hecta, cung cấp hơn 450 triệu ngọn giống, 200 triệu cành hoa với 50% sản lượng hoa xuất khẩu và hàng triệu chậu hoa mỗi năm.</p><p><strong>Đầu tư công nghệ cao</strong></p><p>Dalat Hasfarm sản xuất hoa tươi theo quy trình khép kín với 4 trang trại rộng gần 320 hecta, trong đó có hơn 180 hecta nhà kính. Quy trình sản xuất hoa tại công ty gồm: thử nghiệm, lai tạo giống mới; trồng cây giống; ươm ngọn và trồng cây con; chăm sóc hoa theo định hướng bền vững; quản lý chất lượng sản phẩm trong và sau thu hoạch; bảo quản và phân phối.</p><p><img src="https://i1-kinhdoanh.vnecdn.net/2019/08/02/1322134096-w500-1328-1564715966.png?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=CDS2rHgkwlAXF5Eic5sXrg" alt="Một góc nhà kính trồng cúc của Dalat Hasfarm."></p><p>Một góc nhà kính trồng cúc của Dalat Hasfarm.</p><p>Đại diện hãng hoa cho biết, tất cả những nhà kính hiện nay của công ty đều được điều khiển hoàn toàn tự động bằng hệ thống Hortimax được nhập khẩu từ Hà Lan. Hệ thống này được thiết lập dựa trên những cảm biến được lắp đặt sẵn để đo các chỉ số như tốc độ gió, cường độ ánh sáng, nhiệt độ, độ ẩm...</p><p>Các chỉ số sau khi đo sẽ được tổng hợp đưa về máy tính chủ, từ đó có những tín hiệu phản hồi để điều khiển phù hợp, nhằm tạo điều kiện sinh trưởng tối ưu cho hoa. Việc trồng hoa trong nhà kính công nghệ cao tạo vùng tiểu khí hậu phù hợp, không bị phụ thuộc thời tiết nên cho hoa năng suất cao, ổn định và chất lượng đồng đều.</p><p>Công ty cũng sử dụng hệ thống tưới nhỏ giọt tự động, hệ thống sưởi ấm, hệ thống đèn LED và băng chuyền thu hoạch hoa nhằm đạt năng suất tối đa, tiết kiệm tài nguyên cũng như nguồn nhân lực. Ngoài ra, bằng cách sử dụng hệ thống xử lý và tái sử dụng nước thải tiên tiến, Dalat Hasfarm chủ động được nguồn nước trồng hoa cũng như góp phần bảo vệ môi trường.</p><p><img src="https://i1-kinhdoanh.vnecdn.net/2019/08/02/1076067947-w500-7744-1564715967.png?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=AKEgnmHtPQlmUZPyObNhUw" alt="Hệ thống băng chuyền thu hoạch và đóng gói hoa trực tiếp tại trang trại"></p><p>Hệ thống băng chuyền thu hoạch và đóng gói hoa trực tiếp tại trang trại.</p><p>"Nhờ vậy, doanh nghiệp đã nâng cao năng suất với sản lượng bình quân hàng năm đạt hơn 200 triệu cành hoa, 6 triệu chậu hoa và 450 triệu ngọn giống, cung ứng cho thị trường trong nước và xuất khẩu", đại diện doanh nghiệp nhấn mạnh.</p><p><strong>Quản lý chất lượng sản phẩm trước và sau thu hoạch</strong></p><p>Theo Dalat Hasfarm, một trong những nguyên nhân khiến tình trạng xuất khẩu của nông sản Việt gặp nhiều trở ngại là do công nghệ trước và sau thu hoạch còn lạc hậu. Do đó, quy trình quản lý chất lượng sản phẩm trước và sau thu hoạch luôn được hãng hoa đặt lên hàng đầu.</p><p>Quá trình đánh giá chất lượng sản phẩm thu hoạch của công ty phải trải qua 3 cấp độ gồm: đánh giá trực tiếp lần đầu ngay tại nhà kính thu hoạch và nhà đóng gói; đánh giá lần 2 bởi bộ phận kiểm soát chất lượng (QC) và lần 3 bởi quản lý cấp cao. Toàn bộ thông tin đánh giá chất lượng sẽ được lưu trữ, báo cáo hàng ngày nhằm kiểm soát tối đa chất lượng sản phẩm.</p><p><img src="https://i1-kinhdoanh.vnecdn.net/2019/08/02/1368645443-w500-1184-1564715967.png?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=hTfA7K9tEASIR-_ZGLq6PQ" alt="Khu vực phân loại và đóng gói hoa của Dalat Hasfarm."></p><p>Khu vực phân loại và đóng gói hoa của Dalat Hasfarm.</p><p>Hoa tươi khó duy trì được chất lượng tươi mới nếu không bảo quản đúng kỹ thuật. Vì thế, khâu bảo quản và phân phối phải luôn tuân theo điều kiện nhiệt độ tiêu chuẩn. Chỉ cần một chút sai lệch nhiệt độ, độ bền của hoa sẽ giảm. Công ty đang vận chuyển hoa tươi bằng hệ thống xe chuyên dụng gắn kèm thiết bị theo dõi nhiệt độ để đảm bảo điều kiện bảo quản hoa tiêu chuẩn trong suốt quá trình phân phối.</p><p><strong>Định hướng phát triển bền vững với sản phẩm hoa sạch, an toàn</strong></p><p>Với mục tiêu trở thành doanh nghiệp đầu tàu trong ngành hoa tươi Việt Nam, Dalat Hasfarm xác định rõ phát triển bền vững là định hướng chiến lược trong tương lai.</p><p>Từ năm 2014, công ty đã bắt đầu nghiên cứu và phát triển các loài côn trùng và nấm có ích để ứng dụng vào trong sản xuất. Thông qua sử dụng Bio-Pro để trồng và kiểm soát sâu bệnh, công ty đã giảm thiểu việc sử dụng hóa chất trên các loại hoa khác nhau.</p><p>Từ đó mang đến những sản phẩm hoa sạch, an toàn, nhằm bảo vệ môi trường và sức khỏe người tiêu dùng, hướng đến một nền nông nghiệp phát triển bền vững. Nổi bật, calimero và những loại hoa chậu như thu hải đường, hồng, violet châu Phi... được chăm sóc bằng Bio-Pro và hầu như không sử dụng hóa chất.</p><p><img src="https://i1-kinhdoanh.vnecdn.net/2019/08/02/1054795148-w500-6340-1564715968.png?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=RhSFrNYxj0LAD9IeXiE1Bw" alt="Máy tự động đang rải chế phẩm sinh học Bio-Pro cho hoa calimero"></p><p>Máy tự động đang rải chế phẩm sinh học Bio-Pro cho hoa calimero.</p><p><strong>Đổi mới, cải tiến sản phẩm</strong></p><p>Hàng năm, công ty Dalat Hasfarm luôn tìm kiếm, thử nghiệm và giới thiệu những loại hoa mới nhằm đáp ứng nhu cầu ngày càng cao của thị trường. Hiện nay công ty có hơn 350 giống hoa với nhiều chủng loại, màu sắc đa dạng. Doanh nghiệp còn mua bản quyền nhiều giống hoa từ nước ngoài để trồng và phân phối tại Việt Nam.</p><p>Sau 25 phát triển, Dalat Hasfarm trở thành một trong những công ty hoa tươi hàng đầu Việt Nam và khu vực Đông Nam Á. Công ty xuất khẩu hoa tươi tới hơn 10 thị trường như Trung Quốc, Đài Loan, Australia... Hoa tươi Dalat Hasfarm cũng đã chinh phục được thị trường khó tính Nhật Bản với hơn 20% sản lượng hoa xuất khẩu mỗi năm.</p><p>Tại Việt Nam, sản phẩm của Dalat Hasfarm đã có mặt tại hầu hết ở tất cả tỉnh thành, hoạt động với 4 trung tâm phân phối, 15 cửa hàng bán lẻ và hơn 65 quầy hoa tại các hệ thống siêu thị. Nhờ đó, công ty luôn đảm bảo chuỗi cung ứng, mang hoa tươi từ trang trại đến trực tiếp người tiêu dùng.</p><p><strong>Tâm Anh</strong></p>', False, 'https://i1-kinhdoanh.vnecdn.net/2019/08/02/1322134096-w500-1328-1564715966.png?w=680&h=0&q=100&dpr=1&fit=crop&s=CDS2rHgkwlAXF5Eic5sXrg', 'Q0V6MSUG9SMM68WF7896B8', '2019-02-12 11:14:27', 'Trent Dobbins', '2022-05-07 13:43:10'),
